import video from '../assets/video-bg.mov';
import './VideoGallery.css';

export default function Video() {
    return (
        <>
            <video src={video} className='video-bg' autoplay controls muted />
            <video src={video} className='video-bg' autoplay controls muted />
            <video src={video} className='video-bg' autoplay controls muted />
            <video src={video} className='video-bg' autoplay controls muted />
        </>
    );
}
